import React from 'react';
import Article from './Article.js';
import './Head.css';

function Head() {
  return (
    <div className='Head'>

      <div>
        <Article />
      </div>

      <div id='about'>
        <b>About Bernard Mendez</b>
      </div>

    </div>
  );
}

export default Head;
